var p=class{filter(o,r,t){return!r||!t?o:o.filter(e=>e[r].toString().toLowerCase().includes(t.toLowerCase()))}};var x=class{paginate(o,r,t){let e=r*t,n=e+t;return o.slice(e,n)}};var f=class{sort(o,r,t){return r?o.sort((e,n)=>{let m=e[r],a=n[r];return t==="asc"?m>a?1:-1:m<a?1:-1}):o}};var c=class{static createFilterStrategy(){return new p}static createSortStrategy(){return new f}static createPaginationStrategy(){return new x}};export{c as a};
